import "./App.css";
import { useState } from "react";

function App() {
  // Datos Personales
  const [nombre, setNombre] = useState("");
  const [apellidoPaterno, setApellidoPaterno] = useState("");
  const [apellidoMaterno, setApellidoMaterno] = useState("");
  const [edad, setEdad] = useState(0);
  const [lugarNacimiento, setLugarNacimiento] = useState(0);
  //Dirección
  const [calle, setCalle] = useState("");
  const [colonia, setColonia] = useState("");
  const [codigoPostal, setCodigoPostal] = useState(0);
  const [municipio, setMunicipio] = useState("");
  const [estado, setEstado] = useState("");
  const [numeroInterior, setNumeroInterior] = useState(0);
  const [pais, setPais] = useState("");

  const mostrarDatos = () => {
    alert(nombre);
  }
  return (
    <div className="App">
      <div className="datos">
        <h2>Datos Personales</h2>
        <label>
          Nombre(s):{" "}
          <input
            onChange={(event) => {
              setNombre(event.target.value);
            }}
            type="text"
          />
        </label>
        <label>
          Apellido Paterno:{" "}
          <input
            onChange={(event) => {
              setApellidoPaterno(event.target.value);
            }}
            type="text"
          />
        </label>
        <label>
          Apellido Materno:{" "}
          <input
            onChange={(event) => {
              setApellidoMaterno(event.target.value);
            }}
            type="text"
          />
        </label>
        <label>
          Edad:{" "}
          <input
            onChange={(event) => {
              setEdad(event.target.value);
            }}
            type="number"
          />
        </label>
        <label>
          Lugar de Nacimiento:{" "}
          <input
            onChange={(event) => {
              setLugarNacimiento(event.target.value);
            }}
            type="text"
          />
        </label>
        <h2>Dirección</h2>
        <label>
          Calle:{" "}
          <input
            onChange={(event) => {
              setCalle(event.target.value);
            }}
            type="text"
          />
        </label>
        <label>
          Colonia:{" "}
          <input
            onChange={(event) => {
              setColonia(event.target.value);
            }}
            type="text"
          />
        </label>
        <label>
          Código Postal:{" "}
          <input
            onChange={(event) => {
              setCodigoPostal(event.target.value);
            }}
            type="number"
          />
        </label>
        <label>
          Municipio:{" "}
          <input
            onChange={(event) => {
              setMunicipio(event.target.value);
            }}
            type="text"
          />
        </label>
        <label>
          Estado:{" "}
          <input
            onChange={(event) => {
              setEstado(event.target.value);
            }}
            type="text"
          />
        </label>
        <label>
          Número Interior:{" "}
          <input
            onChange={(event) => {
              setNumeroInterior(event.target.value);
            }}
            type="number"
          />
        </label>
        <label>
          Pais:{" "}
          <input
            onChange={(event) => {
              setPais(event.target.value);
            }}
            type="text"
          />
        </label>

        <button onClick={mostrarDatos}>Registrar</button>
      </div>
    </div>
  );
}

export default App;
